    <div class="container">
    <div class="row">
    <div class="col-sm-4">

    <form className='form1'  >
        <input type="text" 
        placeholder='Name' 
        className='formbody' 
        name='name'
        value={this.state.name}
        ></input><br/>

        <input type="email" 
        placeholder='Email' 
        className='formbody' 
        name='email'></input><br/>

        <input type="number" 
        placeholder='Mobile' 
        className='formbody' 
        name='phone'></input><br/>

        <input type="text" placeholder='Choose Course' className='formbody' name='course'></input><br/>
        <button className='formbutton'> Submit</button>
    </form>
    </div>
    <div class='col-sm-6'>
        <p className='fbody'>Language Zone Dehradun is a best foreign Language training provider in Dehradun 
